import React from 'react';
import './Post.css';

const Post = ({ postList }) => {
  return (
    <div className="post-container">
      {postList.map(post => (
        <div key={post.id} className="post-card">
          <p className="post-content">{post.content}</p>
        </div>
      ))}
    </div>
  );
};

export default Post;
